import React from 'react';
import Sdata from './Sdata';
import Card from './Cards';

const Amazon =() => {
(
    <Card
        key={val.id}
        imgscr={val.imgscr}
        title={val.title}
        sname={val.sname}
        link={val.links}
    />
)}


export default Amazon;
